import React, {Component} from 'react';
import './Deckcard.css';
import styled from 'styled-components';


class DeckCard extends Component {
    constructor(props) {
        super(props)
        this.state = {
            localDeckName: "Deck Name"
        }
    }

    render() {
        return (
            <div className = "DeckCard">
                <div className="DeckCardInner">
                    <div className="Dot"></div>
                    <div className="DeckName">{this.state.localDeckName}</div>
                    <DownloadButton className="DownloadButton" src={`https://file.rendit.io/n/fLL2JGVQtTEi76w4SYXf.svg`}></DownloadButton>
                </div>
            </div>
        )
    }
}


const DownloadButton = styled.img`
  width: 35.2px;
  height: 32px;
  align-self: flex-end;
`;

export default DeckCard
